select ID,IP into #tipoPlacaInserir from Catraca where TipoPlaca = '3'
declare @contador int = 2
declare @contadorplaca int = 0
declare @IPatual nvarchar(max) = ''
declare @count int = (select Count(*) from Catraca where TipoPlaca = '3')

WHILE @contadorplaca < @count
BEGIN
	
	SET @IPatual = ( select top 1 IP from #tipoPlacaInserir)
	INSERT INTO GrupoLinears (GrpID,Ativo,EquipamentoIP,ZonaTempo,ZonaTempoEquipamento) VALUES(0,1,(select IP from Catraca where IP = @IPatual),0,0)
	INSERT INTO GrupoLinears (GrpID,Ativo,EquipamentoIP,ZonaTempo,ZonaTempoEquipamento) VALUES(1,1,(select IP from Catraca where IP = @IPatual),0,0)
	WHILE @contador <= 16
	BEGIN
		INSERT INTO GrupoLinears (GrpID,Ativo,EquipamentoIP,ZonaTempo) VALUES(@contador,0,(select IP from Catraca where IP = @IPatual),0)
		SET @contador = @contador + 1
	END
	delete from #tipoPlacaInserir where IP = (select IP from Catraca where IP = @IPatual)
	SET @contadorplaca = @contadorplaca + 1
END
