CREATE proc [dbo].[sp_insPessoa]
	@ID	int, 
	@Nome varchar(100), 
	@Sexo varchar(1), 
	@RG as varchar(30), 
	@CPF as varchar(14), 
	@Tipo as varchar(50),
	@BloqueiaAcesso as bit, 
	@NumeroVaga as varchar(10), 
	@Unidade as varchar(50), 
	@Bloco as varchar(50)
As

	Insert into Pessoa 
				(
				Nome, 
				Sexo, 
				RG, 
				CPF, 
				Tipo,
				BloqueiaAcesso, 
				NumeroVaga, 
				Unidade, 
				Bloco, 
				DataCadastro,
				DepartamentoID
				)
	Values		(
				@Nome, 
				@Sexo, 
				@RG, 
				@CPF, 
				@Tipo,
				@BloqueiaAcesso, 
				@NumeroVaga, 
				@Unidade, 
				@Bloco, 
				getdate(),
				(Select top 1 ID From Departamento Where Nome = @Bloco and DataExclusao is Null)
				)
	Select ID=@@IDENTITY


